import React from "react";
import "./FAQ.css";

function FAQ() {
  return (
    <>
      <div className="container">
        <h1 className="page-title">Frequently Asked Questions</h1>
        <hr></hr>
        <h2 classname="Q">How will I receive my reading?</h2>
        <p className="A"></p>
      </div>
    </>
  );
}

export default FAQ;
